B.a8a=new A.d_("Information Collection and Use","  For a better experience, while using our Service, we may require you to provide us with certain personally identifiable information, including but not limited to none. The information that we request will be retained by us and used as described in this privacy policy.\n  The app does not use third party services that may collect information used to identify you.\n  ",t.U)
B.a81=new A.d_("Log Data","  We want to inform you that whenever you use our Service, in a case of an error in the app we collect data and information (through third party products) on your phone called Log Data. This Log Data may include information such as your device Internet Protocol (\u201cIP\u201d) address, device name, operating system version, the configuration of the app when utilizing our Service, the time and date of your use of the Service, and other statistics.\n  ",t.U)
B.a84=new A.d_("Cookies","  Cookies are files with a small amount of data that are commonly used as anonymous unique identifiers. These are sent to your browser from the websites that you visit and are stored on your device's internal memory.\n  This Service does not use these \u201ccookies\u201d explicitly. However, the app may use third party code and libraries that use \u201ccookies\u201d to collect information and improve their services. You have the option to either accept or refuse these cookies and know when a cookie is being sent to your device. If you choose to refuse our cookies, you may not be able to use some portions of this Service.\n  ",t.U)
B.a82=new A.d_("Service Providers","  We may employ third-party companies and individuals due to the following reasons:\n\n  To facilitate our Service;\n  To provide the Service on our behalf;\n  To perform Service-related services; or\n  To assist us in analyzing how our Service is used.\n  We want to inform users of this Service that these third parties have access to your Personal Information. The reason is to perform the tasks assigned to them on our behalf. However, they are obligated not to disclose or use the information for any other purpose.\n  ",t.U)
B.a7Z=new A.d_("Security","  We value your trust in providing us your Personal Information, thus we are striving to use commercially acceptable means of protecting it. But remember that no method of transmission over the internet, or method of electronic storage is 100% secure and reliable, and we cannot guarantee its absolute security.\n  ",t.U)
B.a8_=new A.d_("Links to Other Sites","  This Service may contain links to other sites. If you click on a third-party link, you will be directed to that site. Note that these external sites are not operated by us. Therefore, we strongly advise you to review the Privacy Policy of these websites. We have no control over and assume no responsibility for the content, privacy policies, or practices of any third-party sites or services.\n  ",t.U)
B.a80=new A.d_("Children\u2019s Privacy","  These Services do not address anyone under the age of 13. We do not knowingly collect personally identifiable information from children under 13. In the case we discover that a child under 13 has provided us with personal information, we immediately delete this from our servers. If you are a parent or guardian and you are aware that your child has provided us with personal information, please contact us so that we will be able to do necessary actions.\n  ",t.U)
B.a8e=new A.d_("Changes to This Privacy Policy","  We may update our Privacy Policy from time to time. Thus, you are advised to review this page periodically for any changes. We will notify you of any changes by posting the new Privacy Policy on this page. These changes are effective immediately after they are posted on this page.\n  ",t.U)
B.a85=new A.d_("Contact Us","  If you have any questions or suggestions about our Privacy Policy, do not hesitate to contact us:\n\n  - webpage: http://www.girappe.com\n  - mail: office@girappe.com\n  ",t.U)
